int i;
int size;
const uint8_t * sound;
	
void Sound_Init(void)
{
	DAC_Init();
	
	i = 0;
	size = 1;
	sound = 0;
};

void Sound_Play(const uint8_t *pt, uint32_t count)
{
	size = count;
	sound = pt;
};

void Sound_Intro(void)
{
	i = 0;
	Sound_Play(Opening_song,48384);
};

void Sound_Die(void)
{
	i = 0;
	Sound_Play(die,19008);
};

void Sound_Siren(void)
{
	Sound_Play(siren_sound,17640);
};

void Sound_Chomp()
{
	Sound_Play(chomp,7900);
}

void Play()
{
  DAC_Out(sound[i]);    // output one value each interrupt 
	i = (i + 1) % size;
}

void Stop()
{
	i = 0;
	size = 1;
}
